class LifeCycle extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            todos : null
        }
    }

    componentDidMount() {
        fetch("todo.json")
        .then(response => {
            return response.json()
        })
        .then(response => {
            this.setState({
                todos : response
